import * as React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  TextField,
  FormControlLabel,
} from "@mui/material";
import { useForm } from "react-hook-form";

const CheckoutForm = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => console.log(data);

  return (
    <Box className="checkingForm">

        {/* <Typography
          gutterBottom
          variant="h6"
          component="div"
          className=""
          style={{
            paddingLeft: "3vw",
            paddingTop: "1vw",
            outline: "none",
            color: "black",
            fontSize: "2.125rem",
          }}
        >
          Checkout
        </Typography> */}
       
      <form onSubmit={handleSubmit(onSubmit)}>
          <TextField
            id="lastName"
            label="Email" 
            fullWidth
            defaultValue=""
            autoComplete="family-name"
            {...register("email")}
            // error="true"
            // helperText="this is error"
          />
         
           <TextField
            required
            id="lastName"
            name="lastName"
            label="Last name"
            fullWidth
            autoComplete="family-name"
            variant="standard"
            {...register("example")}
          />
          <Button variant="contained" type="submit">
            Log In
          </Button>
        </form>
    </Box>
  );
};

export default CheckoutForm;
